BEGIN;

	CREATE OR REPLACE FUNCTION st_area_utm(geom geometry, srid integer, r numeric, mh integer)
		RETURNS numeric AS
	$BODY$DECLARE

	-- srid : EPSG-Code des Koordinatensystems, bei dem die Flächenreduktion berücksichtigt werden soll
	-- r : Erdradius in Metern
	-- mh : Mittelwert für die Quasigeoidundulation

		area_utm numeric;
		area_loop numeric;
		em numeric; 
		i integer;
		k numeric;
		mpoint geometry;
		mgeom geometry;
		NumB integer;
		NBH integer;  
		x character varying;
		y character varying;  
	Begin

	IF st_srid(geom) != srid THEN
		return st_area(geom);
	ELSE
	 BEGIN
	 
		IF (GeometryType(geom) != 'POLYGON' AND GeometryType(geom) != 'MULTIPOLYGON') THEN 
			return 0;
		END IF;
	 
		IF (GeometryType(geom) = 'POLYGON') THEN 
			BEGIN 
				em=0;

				mpoint = st_centroid(geom);
				x = st_x(mpoint);
				y = st_y(mpoint);
				em = x;

				NumB='33'||substr(x,1,1)||substr(y,1,1)||substr(y,2,1)||substr(x,2,1)||substr(x,3,1)||substr(y,3,1)||substr(y,4,1) as integer;
				SELECT mhoehe INTO NBH FROM utm_nbh WHERE utm_nbh.nb = NumB;
				IF NBH IS NULL THEN
					return st_area(geom);
				END IF;
				NBH=mh+NBH;

				--red. UTM-Fläche berechnen
				k = (1 - (NBH / r)) * (1 + (((em - 500000)*(em - 500000))/(2 * r * r))) * 0.9996 ;
				area_utm = st_area(geom) / (k * k);
			 
				RETURN area_utm;
			 
			END;
		END IF;

		IF (GeometryType(geom) = 'MULTIPOLYGON') THEN 
			BEGIN 
				i=1;  
				area_utm=0;

				-- Multipolygon in Polygone und Neuaufruf Funktion (siehe Geometrietyp Polygon) aller Einzelpolygone
				WHILE i<=ST_NumGeometries(geom) LOOP
					mgeom=st_geometryn(geom, i);
					area_loop=st_area_utm(mgeom, srid, r, mh);
					area_utm=area_utm+area_loop;
					i=i+1;    
				END LOOP;      	

				RETURN area_utm;
			 
			END;
		END IF;

		END;
	END IF;

	End;$BODY$
	LANGUAGE plpgsql VOLATILE
	COST 100;
	
	
	
	CREATE OR REPLACE FUNCTION st_length_utm(geom geometry, srid integer, r numeric, mh integer)
		RETURNS numeric AS
	$BODY$DECLARE

	-- srid : EPSG-Code des Koordinatensystems, bei dem die Streckenreduktion berücksichtigt werden soll
	-- r : Erdradius in Metern
	-- mh : Mittelwert für die Quasigeoidundulation

		length_utm numeric;
		length_loop numeric;
		em numeric; 
		i integer;
		k numeric;
		mpoint geometry;
		mgeom geometry;
		NumB integer;
		NBH integer;  
		x character varying;
		y character varying;  
	Begin

	IF st_srid(geom) != srid THEN
		return st_length(geom);
	ELSE
	 BEGIN
	 
		IF (GeometryType(geom) != 'LINESTRING' AND GeometryType(geom) != 'MULTILINESTRING') THEN 
			return 0;
		END IF;

		IF (GeometryType(geom) = 'LINESTRING') THEN 
			BEGIN 
				em=0;

				mpoint = st_centroid(geom);
				x = st_x(mpoint);
				y = st_y(mpoint);
				em = x;

				NumB='33'||substr(x,1,1)||substr(y,1,1)||substr(y,2,1)||substr(x,2,1)||substr(x,3,1)||substr(y,3,1)||substr(y,4,1) as integer;
				SELECT mhoehe INTO NBH FROM utm_nbh WHERE utm_nbh.nb = NumB;
				IF NBH IS NULL THEN
					return st_length(geom);
				END IF;
				NBH=mh+NBH;

				--red. UTM-Strecke berechnen
				k = (1 - (NBH / r)) * (1 + (((em - 500000)*(em - 500000))/(2 * r * r))) * 0.9996 ;
				length_utm = st_length(geom) / k;
			 
				RETURN length_utm;
			 
			END;
		END IF;

		IF (GeometryType(geom) = 'MULTILINESTRING') THEN 
			BEGIN 
				i=1;  
				length_utm=0;

				-- Multilinestring in Linestrings und Neuaufruf Funktion (siehe Geometrietyp Linestring) aller Einzellinestrings
				WHILE i<=ST_NumGeometries(geom) LOOP
					mgeom=st_geometryn(geom, i);
					length_loop=st_length_utm(mgeom, srid, r, mh);
					length_utm=length_utm+length_loop;
					i=i+1;    
				END LOOP;      	

				RETURN length_utm;
			 
			END;
		END IF;

		END;
	END IF;

	End;$BODY$
	LANGUAGE plpgsql VOLATILE
	COST 100;
	
	
	
	SET client_encoding = 'UTF8';
	SET search_path = public, pg_catalog;

	CREATE TABLE utm_nbh (
			gid integer NOT NULL,
			nb integer,
			mhoehe integer
	);

	CREATE SEQUENCE utm_nbh_gid_seq
			START WITH 1
			INCREMENT BY 1
			NO MINVALUE
			NO MAXVALUE
			CACHE 1;

	ALTER SEQUENCE utm_nbh_gid_seq OWNED BY utm_nbh.gid;
	SELECT pg_catalog.setval('utm_nbh_gid_seq', 1, false);
	ALTER TABLE ONLY utm_nbh ALTER COLUMN gid SET DEFAULT nextval('utm_nbh_gid_seq'::regclass);

	-- NBHs für MV

	CREATE UNIQUE INDEX utm_nbh_gid ON utm_nbh USING btree (gid);
	CREATE UNIQUE INDEX utm_nbh_nb ON utm_nbh USING btree (nb);

COMMIT;
